resourceInfo.abstract:
This region-wide coordinated bird monitoring program, supported by state, federal, tribal, nongovernmental organizations, and two statewide bird conservation partnerships, is designed to provide spatially-referenced baseline data for science-based biological planning and conservation design for the Great Northern LCC and its partners that is directly comparable with other landscapes and BCRs. We are requesting a third year of funding to continue sampling in BCR10 Montana and Idaho to enhance our ability to make robust inference to bird populations on grassland, shrublands, and riparian systems. These data currently are being used by project partners to develop spatially-explicit models that will allow assessment of priority bird species responses to climate and other landscape-scale stressors.

2010-2013 Objectives:

1. Acquire robust, spatially-explicit density or occupancy estimates for grassland, sagebrush, and riparian-associated birds: 10-15 Species of Concern in Montana; 5-15 Species of Greatest Conservation Concern in Idaho; and approximately 70 more common landbird species;
2. Link population estimates generated through the monitoring program to habitat conservation objectives at multiple spatial scales through ongoing modeling efforts, such as the Intermountain West Joint Venture HabPops modeling effort and Montana Fish, Wildlife and Parks Crucial Areas and Corridors Assessment;
3. Integrate existing bird monitoring efforts in the region to provide better information on distribution and abundance of all breeding birds, especially for high priority species;
4. Maintain a high-quality database that is accessible to all of our collaborators as well as to the public over the internet, in the form of raw and summarized data and;
5. Generate decision support tools that guide conservation planning and delivery efforts and can ultimately provide improved assessments of conservation actions at multiple spatial scales
